import React from "react";
import { useState } from "react";
import "./RegisterForm.css";
import Button from "../Button/Button";

export default function RegisterForm() {
  const [bookingNumber, setBookingNumber] = useState("");
  const [name, setName] = useState("");
  const [password, setPassword] = useState("");

  function handleInputChange(event) {
    setName(event.target.value);
  }

  function handleBookingNumberChange(event) {
    setBookingNumber(event.target.value);
  }

  function handlePasswordChange(event) {
    setPassword(event.target.value);
  }

  return (
    <div>
      <form>
        {/*Booking number*/}
        <div className="form-item">
          <label htmlFor="bookingnumber">Insert booking number</label>
          <input
            type="text"
            className="form-control"
            id="bookingnumber"
            onChange={handleBookingNumberChange}
          />
          <p> BOOKING INPUT IS: {bookingNumber}</p>
        </div>

        {/*Username*/}
        <div className="form-item">
          <label htmlFor="username">Username</label>
          <input
            type="username"
            className="form-control"
            id="username"
            onChange={handleInputChange}
          />
          <p> NAME INPUT IS: {name}</p>
        </div>

        {/*Create password*/}
        <div className="form-item">
          <label htmlFor="password-create">Create password</label>
          <input
            type="password"
            className="form-control"
            id="password-create"
            onChange={handlePasswordChange}
          />
          <p> PASSWORD INPUT IS: {password}</p>
        </div>

        {/*Confirm password*/}
        <div className="form-item">
          <label htmlFor="password-confirm">Confirm password</label>
          <input
            type="password"
            className="form-control"
            id="password-confirm"
          />
        </div>
      </form>
    </div>
  );
}
